def make_theta_two_prop(m, at, ab, bt, bb, zt, zb):
    """Create and populate the theta_two_prop matrix for spec1d
        
    
    The theta_two_prop matrix depends on depth dependance of two linear 
    properties against the basis fuction.
        
    Parameters
    ----------
    m : ``list`` of ``float``
        eigenvlaues of BVP. generate with spec1d.m_func
    at : ``list`` of ``float``
        first property at top of each layer
    ab : ``list`` of ``float``
        first propertyat bottom of each layer        
    bt : ``list`` of ``float``
        second property at top of each layer
    bb : ``list`` of ``float``
        second property at bottom of each layer        
    zt : ``list`` of ``float``    
        normalised depth or z-coordinate at top of each layer. `zt[0]` = 0
    zb : ``list`` of ``float``
        normalised depth or z-coordinate at bottom of each layer. `zt[-1]` = 1
             
    Returns
    -------
    thsig : numpy.ndarray
        returns the column vector thesig, size determined by size of `m`
        
    See Also
    --------
    mfunc : used to generate 'm' input parameter
    
    Notes
    -----
    theta_two_prop is used when integrating two linear properties against the basis fuction.
    
    .. math:: \\mathbf{\\theta}_{two prop, i}=\\int_{0}^1{a\\left(Z\\right)b\\left(Z\\right)\\phi_i\\,dZ}    
    
    Specifically it is used in calculating :math:`\\mathbf{\\theta}_\\sigma` 
    which arises when integrating the depth dependant volume compressibility 
    (:math:`m_v`) and surcharge :math:`\\sigma` against the spectral basis 
    functions:
    
    .. math:: \\mathbf{\\theta}_{\\sigma,i}=\\int_{0}^1{\\frac{m_v}{\\overline{m}_v}\\sigma\\left(Z\\right)\\phi_i\\,dZ}
    
    It is also used in calculating :math:`\\mathbf{\\theta}_w` 
    which arises when integrating the depth dependant vertical drain parameter  
    (:math:`\\eta`) and vacuum :math:`w` against the spectral basis 
    function:
        
    .. math:: \\mathbf{\\theta}_{w,i}=dTh\\int_{0}^1{\\frac{\\eta}{\\overline{\\eta}}w\\left(Z\\right)\\phi_i\\,dZ}
        
    """
    from math import sin, cos
    
    neig = len(m)
    nlayers = len(zt)
    
    theta_two_prop = numpy.zeros(neig, float)        
